import React from "react";

class Titles extends React.Component {
    render() {
      return(
        <div>
          <h1 className="title-container__title">RISET</h1>
          <p className="title-container__subtitle">Find the time of sunrises and sunsets</p>
        </div>
      )
    }
}

export default Titles
